        //         <Navbar.Brand  >
        //             <NavLink to="/home" className="text-white">
        //                 <h3> We Care</h3>
        //             </NavLink>
        //         </Navbar.Brand>


        //         <Navbar.Text >
        //             <Stack direction="horizontal" gap={3}>

        //                 
        //                

        //             </Stack>
        //         </Navbar.Text>


        //     </Navbar>
        // </div>
    );
};

export default Header;
